pragma solidity ^0.4.11;
import "zeppelin-solidity/contracts/ownership/Ownable.sol";
import "./Employee.sol";
import "./Company.sol";
import "./Contract.sol";


contract Main is Ownable {

    Employee[] public employees;
    Company[] public companies;
    Contract[] public contracts;
    address public specializations;

    function Main() public payable {}

    function () public payable {}

    function newEmployee(string _firstName, string _lastName, string _email, address _address) public onlyOwner {
        Employee employee = new Employee(_firstName, _lastName, _email, _address);
        employees.push(employee);
    }

    function newCompany(string _name, uint _rating, address _address) public onlyOwner {
        Company company = new Company(_name, _rating, _address);
        companies.push(company);
    }

    function newContract(uint[] _skillCodes, uint[] _skillToPosition,
                            uint _startDate, uint _endDate, Employee _empoloyee,
                            Company _company, uint _weekPayment) public onlyOwner {
        Contract _contract = new Contract(_skillCodes, _skillToPosition,
                                            _startDate, _endDate, _empoloyee, _company, _weekPayment);
        contracts.push(_contract);
    }

    function getAccountSizes() public view returns (uint, uint, uint) {
        return (employees.length, companies.length, contracts.length);
    }

    function setSpecializations(address _specializations) public {
        specializations = _specializations;
    }

    function kill() public {
        selfdestruct(owner);
    }

}
